import React from 'react'

const Skill = ({skills}) => {
  return (
    <>
    {skills.map(item => {
                return (
                <div className='skill__item'>
                    <div className='skill__item__name'>{item.displayName}</div>
                    <img  className='skill__item__img' src={item.avatarUrl.url} alt="" />
                </div>
                )

        })}
    </>
  )
}

export default Skill
